/   }\n\n@mixin bpk-text {\n  margin: 0;\n}\n\n/// Extra small text style\n///\n/// @require {mixin} bpk-text\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text;\n///     @include bpk-text--xs;\n///   }\n\n@mixin bpk-text--xs {\n  @include _bpk-text-factory(\n    $bpk-font-size-xs,\n    $bpk-line-height-xs,\n    $bpk-font-weight-book\n  );\n}\n\n/// Extra small text style (without margin reset)\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text-xs;\n///   }\n\n@mixin bpk-text-xs {\n  @include bpk-text--xs;\n}\n\n/// Small text style\n///\n/// @require {mixin} bpk-text\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text;\n///     @include bpk-text--sm;\n///   }\n\n@mixin bpk-text--sm {\n  @include _bpk-text-factory(\n    $bpk-font-size-sm,\n    $bpk-line-height-sm,\n    $bpk-font-weight-book\n  );\n}\n\n/// Small text style (without margin reset)\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text-sm;\n///   }\n\n@mixin bpk-text-sm {\n  @include bpk-text--sm;\n}\n\n/// Base text style\n///\n/// @require {mixin} bpk-text\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text;\n///     @include bpk-text--base;\n///   }\n\n@mixin bpk-text--base {\n  @include _bpk-text-factory(\n    $bpk-font-size-base,\n    $bpk-line-height-base,\n    $bpk-font-weight-book\n  );\n}\n\n/// Base text style (without margin reset)\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text-base;\n///   }\n\n@mixin bpk-text-base {\n  @include bpk-text--base;\n}\n\n/// Large text style\n///\n/// @require {mixin} bpk-text\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text;\n///     @include bpk-text--lg;\n///   }\n\n@mixin bpk-text--lg {\n  @include _bpk-text-factory(\n    $bpk-font-size-lg,\n    $bpk-line-height-lg,\n    $bpk-font-weight-book\n  );\n}\n\n/// Large text style (without margin reset)\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text-lg;\n///   }\n\n@mixin bpk-text-lg {\n  @include bpk-text--lg;\n}\n\n/// Extra large text style\n///\n/// @require {mixin} bpk-text\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text;\n///     @include bpk-text--xl;\n///   }\n\n@mixin bpk-text--xl {\n  @include _bpk-text-factory(\n    $bpk-font-size-xl,\n    $bpk-line-height-xl,\n    $bpk-font-weight-book\n  );\n}\n\n/// Extra large text style (without margin reset)\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text-xl;\n///   }\n\n@mixin bpk-text-xl {\n  @include bpk-text--xl;\n}\n\n/// Extra extra large text style\n///\n/// @require {mixin} bpk-text\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text;\n///     @include bpk-text--xxl;\n///   }\n\n@mixin bpk-text--xxl {\n  @include _bpk-text-factory(\n    $bpk-font-size-xxl,\n    $bpk-line-height-xxl,\n    $bpk-font-weight-bold\n  );\n}\n\n/// Extra extra large text style (without margin reset)\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text-xxl;\n///   }\n\n@mixin bpk-text-xxl {\n  @include bpk-text--xxl;\n}\n\n/// Extra extra large text style\n///\n/// @require {mixin} bpk-text\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text;\n///     @include bpk-text--xxxl;\n///   }\n\n@mixin bpk-text--xxxl {\n  @include _bpk-text-factory(\n    $bpk-font-size-xxxl,\n    $bpk-line-height-xxxl,\n    $bpk-font-weight-bold\n  );\n}\n\n/// Extra extra large text style (without margin reset)\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text-xxxl;\n///   }\n\n@mixin bpk-text-xxxl {\n  @include bpk-text--xxxl;\n}\n\n/// Extra extra large text style\n///\n/// @require {mixin} bpk-text\n///\n/// @example scss\n///   .selector {\n///     @include bpk-text;\n///     @include bpk-text--xxxxl;\n///   }\n\n@mixin bpk-text--xxxxl {\n  @include _bpk-text-factory(\n    $bpk-font-size-xxxxl,\n    $bpk-line-height-xxxxl,\n    $bpk-font-weight-bold,\n    $bpk-letter-spacing-tight\n  );\n}\n\